                    <style>
                        svg#freepik_stories-404-error-with-people-holding-the-numbers:not(.animated) .animable {
                            opacity: 0;
                        }

                        svg#freepik_stories-404-error-with-people-holding-the-numbers.animated #freepik--background-complete--inject-1 {
                            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-404-error-with-people-holding-the-numbers.animated #freepik--Shadow--inject-1 {
                            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-404-error-with-people-holding-the-numbers.animated #freepik--trafic-cone-2--inject-1 {
                            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomOut;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-404-error-with-people-holding-the-numbers.animated #freepik--trafic-cone-1--inject-1 {
                            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideRight;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-404-error-with-people-holding-the-numbers.animated #freepik--character-3--inject-1 {
                            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-404-error-with-people-holding-the-numbers.animated #freepik--character-2--inject-1 {
                            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedLeft;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-404-error-with-people-holding-the-numbers.animated #freepik--character-1--inject-1 {
                            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
                            animation-delay: 0s;
                        }

                        svg#freepik_stories-404-error-with-people-holding-the-numbers.animated #freepik--Text--inject-1 {
                            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp;
                            animation-delay: 0s;
                        }

                        @keyframes lightSpeedRight {
                            from {
                                transform: translate3d(50%, 0, 0) skewX(-20deg);
                                opacity: 0;
                            }

                            60% {
                                transform: skewX(10deg);
                                opacity: 1;
                            }

                            80% {
                                transform: skewX(-2deg);
                            }

                            to {
                                opacity: 1;
                                transform: translate3d(0, 0, 0);
                            }
                        }

                        @keyframes zoomOut {
                            0% {
                                opacity: 0;
                                transform: scale(1.5);
                            }

                            100% {
                                opacity: 1;
                                transform: scale(1);
                            }
                        }

                        @keyframes slideRight {
                            0% {
                                opacity: 0;
                                transform: translateX(30px);
                            }

                            100% {
                                opacity: 1;
                                transform: translateX(0);
                            }
                        }

                        @keyframes slideDown {
                            0% {
                                opacity: 0;
                                transform: translateY(-30px);
                            }

                            100% {
                                opacity: 1;
                                transform: translateY(0);
                            }
                        }

                        @keyframes lightSpeedLeft {
                            from {
                                transform: translate3d(-50%, 0, 0) skewX(20deg);
                                opacity: 0;
                            }

                            60% {
                                transform: skewX(-10deg);
                                opacity: 1;
                            }

                            80% {
                                transform: skewX(2deg);
                            }

                            to {
                                opacity: 1;
                                transform: translate3d(0, 0, 0);
                            }
                        }

                        @keyframes slideUp {
                            0% {
                                opacity: 0;
                                transform: translateY(30px);
                            }

                            100% {
                                opacity: 1;
                                transform: inherit;
                            }
                        }
